import React from 'react';
import { Link } from 'react-router-dom';
import './Menu.css'; // Import your MenuPage styles
import Nav from './Nav';
import Footer from './Footer';
const categoryImages = {
    "Pizza": "data:image/jpeg;base64,",
    "Side Orders": "data:image/jpeg;base64,",
    "Beverages": "data:image/jpeg;base64,",
};

const Menu = () => {
    const categories = [
        { title: "Pizza", description: "Delicious pizza options", link: "/home/menu/pizza" },
        { title: "Side Orders", description: "Tasty side orders", link: "/home/menu/sides" },
        { title: "Beverages", description: "Refreshing beverages", link: "/home/menu/beverages" },
    ];
    
    const scrollToTop = () => {
        window.scrollTo({ top: 0, behavior: 'smooth' });
    }

    return (
        <div className="menu-page">
            <Nav/>
            <h2>Menu</h2>
            <div className="card-container">
                {categories.map((category, index) => (
                    <div key={index} className="card">
                        <img src={categoryImages[category.title]} alt={category.title} />
                        <h3>{category.title}</h3>
                        <p>{category.description}</p>
                        <Link to={category.link} className="view-all-button">
                            View All
                        </Link>
                    </div>
                ))}
            </div>
            <Footer scrollToTop={scrollToTop}/> 
        </div>
    );
}

export default Menu;
